	{"8x"},
}

selected_attachment = 1

function FullAutoRecoil(start_ms, option)
	recoil_graph = recoil_graphs[option[1]]

	zoom_factor = 1 / option[2]

	fov = fov_base

	attachments = attachment_options[selected_attachment]

	if (contains_value(attachments, "holo")) then
		fov = fov * holo
	end

	if (contains_value(attachments, "8x")) then
		fov = fov * eightex
	end

	factor = (fov / 666.66666) * sens 

	-- needed for calcing the diff to move
	last_position = {0, 0}

	if (legit) then
		x_adjust = math.random(90, 110) / 100
		y_adjust = math.random(90, 110) / 100
	else
		-- no adjustment factor
		x_adjust = 1
		y_adjust = 1
	end

	if (contains_value(attachments, "silencer") or contains_value(attachments, "8x")) then
		x_adjust = x_adjust * 0.8
		y_adjust = y_adjust * 0.8
	end
	
	-- pixel pool, the amount of non full pixels that are left over after using closest_int
	x_px_pool = 0
	y_px_pool = 0
	repeat
    	-- values work based on a recoil graph that contains the recoil 
    	-- for each millisecond	
		passed_ms = GetRunningTime() - start_ms

		position = recoil_graph[passed_ms]
		if(position ~= nil and IsMouseButtonPressed(3)) then
    		-- how much we should move raw
			now_move_y = position[2] - last_position[2]

			-- calculate pixel to move
			move_y_px = (now_move_y / factor) * y_adjust

			-- add left over pixel from previous iteration
			move_y_px = move_y_px + y_px_pool
	    		
			-- floor it 
			move_y_px_floored = closest_int(move_y_px)

			-- get left over pixel once again
			y_px_pool = move_y_px - move_y_px_floored

			-- update the total that we moved
			last_position[2] = position[2]

			-- same for x
			now_move_x = position[1] - last_position[1]

			move_x_px = (now_move_x / factor) * x_adjust

			move_x_px = move_x_px + x_px_pool

			move_x_px_floored = closest_int(move_x_px)

			x_px_pool = move_x_px - move_x_px_floored

			last_position[1] = position[1]

			-- adjust recoil
			MoveMouseRelative(-move_x_px_floored, -move_y_px_floored)
		end
		Sleep(1)
	until not IsMouseButtonPressed(1)
end

function OnEvent(event, arg)

	if (event == "MOUSE_BUTTON_PRESSED" and arg == 1 and activated) then

		start_ms = GetRunningTime()

		weapon_option = weapon_options[selected_weapon]
		
		FullAutoRecoil(start_ms, weapon_option)
		
    end

	-- enable trigger on mouse one
    if (event == "PROFILE_ACTIVATED") then
        EnablePrimaryMouseButtonEvents(true)
    end

	if (event == "MOUSE_BUTTON_PRESSED" and arg == 6) then
        legit = not legit
        OutputLogMessage("legit: %s - %s\n", tostring(legit), weapon_options[selected_weapon][1])
    end

    if (event == "MOUSE_BUTTON_PRESSED" and arg == 3) then
        activated = not activated
        OutputLogMessage("activated: %s - %s\n", tostring(activated), weapon_options[selected_weapon][1])
        print_attachments()
    end

	-- change attachments
	if (event == "MOUSE_BUTTON_PRESSED" and arg == 4) then
        if selected_attachment >= #attachment_options then
            selected_attachment = 1
        else
            selected_attachment = selected_attachment +1
        end
        print_attachments()
    end 

	-- change weapon button
    if (event == "MOUSE_BUTTON_PRESSED" and arg == 5) then
        if selected_weapon >= #weapon_options then
            selected_weapon = 1
        else
            selected_weapon = selected_weapon +1
        end
        OutputLogMessage("Selected: %s\n", weapon_options[selected_weapon][1])
        print_attachments()
    end 
end

function print_attachments() 
    OutputLogMessage("Selected attachments ")
	for index, attachment in ipairs(attachment_options[selected_attachment]) do
		OutputLogMessage("%s ", attachment)
	end

	OutputLogMessage("\n")
end

function contains_value (tab, val)
    for index, value in ipairs(tab) do
        if value == val then
            return true
        end
    end

    return false
end


function closest_int(val)
	if val > 0 then
		return math.floor(val)
	else
		return math.ceil(val)
	end
end
